/**
 * @param {number[]} nums
 * @param {number} threshold
 * @return {number}
 */
var smallestDivisor = function(nums, threshold) {
    const sum = nums.reduce((acc,val)=>{ return acc+val; });
    let l = Math.floor(sum/threshold);
    let h = Math.max(...nums);
    while(l<h){
        const m = Math.floor((h+l)/2);
        let curSum = 0;
        for(let j=0;j<nums.length;j++){
            curSum += Math.ceil(nums[j]/m)
        }
        if(curSum<=threshold){
            h = m;
        } else { 
            l = m+1; 
        }
    }
    return l;
};

function test(nums, threshold){
    console.log({threshold,result:smallestDivisor(nums, threshold)});
}

